import React from 'react';
import './App.css';
import { parseWithOptions } from 'date-fns/fp';

function Nav(props) {
        const degree="C";
        return(
        <nav>
            <div>
                <input className="search-input" onChange={props.handleInput}/>
                <button className="search-btn"><i class="fa fa-search"></i></button>
                <button className="temp-switch">
                    <i
                    className="fa fa-thermometer-empty"
                    aria-hidden="true"
                    style={{paddingRight: '5px'}}></i>
                    <sup>&deg;</sup>{degree}
                </button>
            </div>
        </nav>

        );
    }

export default Nav;
